import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import { Button } from '@/components/ui/button';
import { Card, CardContent, CardDescription, CardHeader, CardTitle } from '@/components/ui/card';
import { Dialog, DialogContent, DialogDescription, DialogHeader, DialogTitle, DialogTrigger } from '@/components/ui/dialog';
import { Input } from '@/components/ui/input';
import { Label } from '@/components/ui/label';
import { DropdownMenu, DropdownMenuContent, DropdownMenuItem, DropdownMenuSeparator, DropdownMenuTrigger } from '@/components/ui/dropdown-menu';
import { Skeleton } from '@/components/ui/skeleton';
import { useAuth } from '@/contexts/AuthContext';
import { supabase } from '@/lib/supabase';
import { Heart, Plus, Settings, LogOut, MoreVertical, ExternalLink, Copy, Trash2, Loader2, Code, Layout, Palette, Eye } from 'lucide-react';
import { useToast } from '@/hooks/use-toast';
import { v4 as uuidv4 } from 'uuid';
import ProfileModal from '@/components/ProfileModal';
import UserProfileImage from '@/components/UserProfileImage';

const Dashboard = () => {
  const { user, profile, signOut, loading: authLoading, refreshProfile } = useAuth();
  const [spaces, setSpaces] = useState([]);
  const [loading, setLoading] = useState(false);
  const [isProfileOpen, setIsProfileOpen] = useState(false);
  const [isProfileModalOpen, setIsProfileModalOpen] = useState(false);
  const [initialLoad, setInitialLoad] = useState(true);
  const [createDialogOpen, setCreateDialogOpen] = useState(false);
  const [newSpaceName, setNewSpaceName] = useState('');
  const [creating, setCreating] = useState(false);

  // --- EMBED MODAL STATE ---
  const [embedDialogOpen, setEmbedDialogOpen] = useState(false);
  const [selectedSpaceId, setSelectedSpaceId] = useState('');
  // Initialize these explicitly
  const [embedTheme, setEmbedTheme] = useState('light');
  const [embedLayout, setEmbedLayout] = useState('grid');
  // -------------------------

  const navigate = useNavigate();
  const { toast } = useToast();

  useEffect(() => {
    if (!authLoading && !user) navigate('/login');
  }, [user, authLoading, navigate]);

  useEffect(() => {
    if (user && initialLoad) {
      fetchSpaces();
      setInitialLoad(false);
    }
  }, [user, initialLoad]);

  const fetchSpaces = async () => {
    setLoading(true);
    try {
      const { data, error } = await supabase
        .from('spaces')
        .select('*, testimonials(count)')
        .eq('owner_id', user.id)
        .order('created_at', { ascending: false });

      if (error) throw error;
      setSpaces(data || []);
    } catch (error) {
      console.error('Error fetching spaces:', error);
    } finally {
      setLoading(false);
    }
  };

  const createSpace = async (e) => {
    e.preventDefault();
    if (!newSpaceName.trim()) return;

    setCreating(true);
    try {
      const slug = newSpaceName.toLowerCase().replace(/[^a-z0-9]+/g, '-') + '-' + uuidv4().slice(0, 6);
      const { data, error } = await supabase
        .from('spaces')
        .insert({
          id: uuidv4(),
          owner_id: user.id,
          space_name: newSpaceName,
          slug: slug,
          header_title: `Share your experience with ${newSpaceName}`,
          custom_message: 'We appreciate your feedback!',
          collect_star_rating: true,
          created_at: new Date().toISOString(),
        })
        .select()
        .single();

      if (error) throw error;
      setSpaces([data, ...spaces]);
      setCreateDialogOpen(false);
      setNewSpaceName('');
      toast({ title: 'Space created!' });
      navigate(`/dashboard/${data.id}`);
    } catch (error) {
      toast({ title: 'Error', description: 'Failed to create space.', variant: 'destructive' });
    } finally {
      setCreating(false);
    }
  };

  const deleteSpace = async (spaceId) => {
    if (!window.confirm('Delete this space?')) return;
    try {
      const { error } = await supabase.from('spaces').delete().eq('id', spaceId);
      if (error) throw error;
      setSpaces(spaces.filter(s => s.id !== spaceId));
      toast({ title: 'Space deleted' });
    } catch (error) {
      toast({ title: 'Error', description: 'Failed to delete space.', variant: 'destructive' });
    }
  };

  const openEmbedModal = (spaceId) => {
    console.log("Opening embed for:", spaceId); // Debug Log
    setSelectedSpaceId(spaceId);
    setEmbedTheme('light');
    setEmbedLayout('grid');
    setEmbedDialogOpen(true);
  };

  const getPreviewUrl = () => {
    const origin = window.location.origin;
    // Always generate a fresh URL based on current state
    let url = `${origin}/embed/${selectedSpaceId}?theme=${embedTheme}&layout=${embedLayout}`;
    return url;
  };

  const getEmbedCode = () => {
    const origin = window.location.origin;
    // Explicitly using the state variables here
    return `<script src="${origin}/embed.js" data-space-id="${selectedSpaceId}" data-theme="${embedTheme}" data-layout="${embedLayout}"></script>`;
  };

  const copyEmbedCode = () => {
    navigator.clipboard.writeText(getEmbedCode());
    toast({ title: 'Code Copied' });
  };

  if (authLoading) return <div className="min-h-screen flex items-center justify-center"><Loader2 className="animate-spin" /></div>;
  if (!user) return null;

  return (
    <div className="min-h-screen bg-slate-50">
      <header className="border-b bg-white sticky top-0 z-50 px-4 py-4 flex justify-between items-center">
        <Link to="/dashboard" className="flex items-center gap-2 font-bold text-xl text-violet-600">
          <Heart className="w-6 h-6 fill-violet-600" /> TrustFlow
        </Link>
        <button onClick={() => handleSignOut()} className="text-sm font-medium text-red-600">Sign Out</button>
      </header>

      <main className="container mx-auto px-4 py-8">
        <div className="flex justify-between items-center mb-8">
          <h1 className="text-3xl font-bold">Your Spaces</h1>
          <Button onClick={() => setCreateDialogOpen(true)}><Plus className="w-4 h-4 mr-2" /> New Space</Button>
        </div>

        <Dialog open={createDialogOpen} onOpenChange={setCreateDialogOpen}>
          <DialogContent>
            <DialogHeader><DialogTitle>Create Space</DialogTitle></DialogHeader>
            <form onSubmit={createSpace} className="space-y-4 mt-4">
              <Input placeholder="Space Name" value={newSpaceName} onChange={(e) => setNewSpaceName(e.target.value)} required />
              <Button type="submit" disabled={creating} className="w-full">{creating ? 'Creating...' : 'Create'}</Button>
            </form>
          </DialogContent>
        </Dialog>

        {loading ? <Skeleton className="h-32 w-full" /> : (
          <div className="grid sm:grid-cols-2 lg:grid-cols-3 gap-6">
            {spaces.map((space) => (
              <Card key={space.id} onClick={() => navigate(`/dashboard/${space.id}`)} className="cursor-pointer hover:shadow-lg transition-all relative group">
                <CardHeader>
                  <CardTitle>{space.space_name}</CardTitle>
                  <CardDescription>{space.testimonials?.[0]?.count || 0} testimonials</CardDescription>
                </CardHeader>
                <div className="absolute top-4 right-4">
                  <DropdownMenu>
                    <DropdownMenuTrigger asChild onClick={(e) => e.stopPropagation()}>
                      <Button variant="ghost" size="sm"><MoreVertical className="w-4 h-4" /></Button>
                    </DropdownMenuTrigger>
                    <DropdownMenuContent align="end">
                      <DropdownMenuItem onClick={(e) => { e.stopPropagation(); openEmbedModal(space.id); }}>
                        <Code className="w-4 h-4 mr-2" /> Embed Widget
                      </DropdownMenuItem>
                      <DropdownMenuItem onClick={(e) => { e.stopPropagation(); deleteSpace(space.id); }} className="text-red-600">
                        <Trash2 className="w-4 h-4 mr-2" /> Delete
                      </DropdownMenuItem>
                    </DropdownMenuContent>
                  </DropdownMenu>
                </div>
              </Card>
            ))}
          </div>
        )}
      </main>

      {/* EMBED MODAL */}
      <Dialog open={embedDialogOpen} onOpenChange={setEmbedDialogOpen}>
        <DialogContent className="max-w-5xl h-[80vh] flex flex-col p-0 overflow-hidden">
          <div className="flex-1 flex flex-col md:flex-row h-full">
            {/* Left: Settings */}
            <div className="w-full md:w-1/3 border-r p-6 bg-slate-50 overflow-y-auto">
              <h3 className="font-bold text-lg mb-6">Customize Widget</h3>

              <div className="space-y-6">
                <div>
                  <Label className="mb-2 block text-xs font-bold text-slate-500 uppercase">Layout</Label>
                  <div className="grid grid-cols-3 gap-2">
                    {['grid', 'masonry', 'carousel'].map((l) => (
                      <button
                        key={l}
                        onClick={() => {
                          console.log("Setting layout to:", l); // Debug Log
                          setEmbedLayout(l);
                        }}
                        className={`px-2 py-2 text-sm rounded border transition-colors ${
                          embedLayout === l ? 'bg-violet-600 text-white border-violet-600' : 'bg-white text-slate-600 hover:bg-slate-100'
                        }`}
                      >
                        {l.charAt(0).toUpperCase() + l.slice(1)}
                      </button>
                    ))}
                  </div>
                </div>

                <div>
                  <Label className="mb-2 block text-xs font-bold text-slate-500 uppercase">Theme</Label>
                  <div className="grid grid-cols-2 gap-2">
                    {['light', 'dark'].map((t) => (
                      <button
                        key={t}
                        onClick={() => setEmbedTheme(t)}
                        className={`px-2 py-2 text-sm rounded border transition-colors ${
                          embedTheme === t ? 'bg-slate-800 text-white border-slate-800' : 'bg-white text-slate-600 hover:bg-slate-100'
                        }`}
                      >
                        {t.charAt(0).toUpperCase() + t.slice(1)}
                      </button>
                    ))}
                  </div>
                </div>

                <div className="pt-6 border-t">
                  <Label className="mb-2 block text-xs font-bold text-slate-500 uppercase">Embed Code</Label>
                  <div className="bg-slate-900 rounded-md p-3 relative group">
                     <button 
                        onClick={copyEmbedCode}
                        className="absolute top-2 right-2 p-1.5 bg-white/10 hover:bg-white/20 rounded text-white text-xs"
                     >
                       Copy
                     </button>
                     <code className="text-xs text-slate-300 font-mono break-all block pr-8">
                       {getEmbedCode()}
                     </code>
                  </div>
                </div>
              </div>
            </div>

            {/* Right: Preview */}
            <div className="w-full md:w-2/3 bg-slate-200 p-8 flex items-center justify-center relative">
               <div className="absolute top-4 left-4 text-xs font-bold text-slate-500 uppercase tracking-wider flex gap-2">
                 <Eye className="w-4 h-4" /> Live Preview
               </div>
               <div className="bg-white rounded-lg shadow-xl w-full h-full max-h-[600px] overflow-hidden">
                 {selectedSpaceId && (
                   <iframe
                     // KEY PROP IS CRITICAL: Forces re-render when state changes
                     key={`${selectedSpaceId}-${embedTheme}-${embedLayout}`}
                     src={getPreviewUrl()}
                     className="w-full h-full border-0"
                     title="Preview"
                   />
                 )}
               </div>
            </div>
          </div>
        </DialogContent>
      </Dialog>
    </div>
  );
};

export default Dashboard;
